export function createMission(data, homeLat, homeLng, homeElevation) {
  // Define the mappings
  const frameMapping = {
    Relative: 3,
    Absolute: 0,
    Terrain: 10,
  };

  const commandMapping = {
    "Return to Launch": 16,
    Land: 21,
    Waypoint: 16,
    "Take Off": 22,
  };

  // Create the output array
  let output = ["QGC WPL 110"];

  // Inserting home location as the first line
  if (homeElevation !== null) {
    let homeLine = `0 1 0 0 0 0 0 0 ${setHomeLat} ${setHomeLng} ${homeElevation} 1`;
    output.push(homeLine);
  }

  data.forEach((item, index) => {
    let altitudeValue = item.command === "Land" ? 0 : item.alt;
    let line = `${index + 1} 0 ${frameMapping[item.frame]} ${
      commandMapping[item.command]
    } ${item.p1} ${item.p2} ${item.p3} ${item.p4} ${item.latitude} ${
      item.longitude
    } ${altitudeValue} 1`;
    output.push(line);
  });

  let outputString = output.join("\n");
  return outputString;
}
